import React from "react";

const Day26 = (props) => {
  return (
    <div className="day">
      <h2>May 26</h2>
      <h3>Montserrat, Cava Tour, and Night Out</h3>

      <div>
        <h4>Montserrat</h4>
        <p>We will be meeting at 8:30AM today in Sitges at LOCATION to hop on the bus and head to Montserrat</p>
        <p>This imposing cathedral on a mountain outside Barcelona is a a fantastic place to explore and take in the history and views</p>
        <p>For those of you looking for an active day there is an option to do a small hike to the top, however there is also a cable car to the top if you'd like to enjoy the ride</p>
      </div>

      <div>
        <h4>Cava Tour at Codorniu</h4>
        <p>Cava is a Spanish sparkling wine, and easily one of the most famous brands is Cordoniu</p>
        <p>Join us as we explore the wonderful vineyard here and taste some of their delicious wares</p>
      </div>

    </div>
  );
};

export default Day26;
